import React from 'react';
import Card from './components/Card';

function Tours({ tours }) {
    return (
        <div>
            <div>
                <h2>Plan for Advanture</h2>
            </div>
            <div>
                {
                    tours.map(() => {
                        return (
                            <Card {...tours} ></Card>
                        )
                    })
                }
            </div>
        </div>
    );
}

export default Tours;
